[[package]]
name = "arger"
version = "1.4.2"
requires_python = ">=3.8,<4.0"
summary = "Create argparser automatically from functions"
dependencies = [
    "typing-extensions>3.7.4",
]

[[package]]
name = "atomicwrites"
version = "1.4.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*"
summary = "Atomic file writes."

[[package]]
name = "attrs"
version = "21.4.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
summary = "Classes Without Boilerplate"

[[package]]
name = "better-exceptions"
version = "0.3.3"
summary = "Pretty and helpful exceptions, automatically"
dependencies = [
    "colorama; sys_platform == \"win32\"",
]

[[package]]
name = "certifi"
version = "2021.10.8"
summary = "Python package for providing Mozilla's CA Bundle."

[[package]]
name = "charset-normalizer"
version = "2.0.12"
requires_python = ">=3.5.0"
summary = "The Real First Universal Charset Detector. Open, modern and actively maintained alternative to Chardet."

[[package]]
name = "colorama"
version = "0.4.4"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
summary = "Cross-platform colored terminal text."

[[package]]
name = "idna"
version = "3.3"
requires_python = ">=3.5"
summary = "Internationalized Domain Names in Applications (IDNA)"

[[package]]
name = "iniconfig"
version = "1.1.1"
summary = "iniconfig: brain-dead simple config-ini parsing"

[[package]]
name = "packaging"
version = "21.3"
requires_python = ">=3.6"
summary = "Core utilities for Python packages"
dependencies = [
    "pyparsing!=3.0.5,>=2.0.2",
]

[[package]]
name = "pluggy"
version = "1.0.0"
requires_python = ">=3.6"
summary = "plugin and hook calling mechanisms for python"

[[package]]
name = "py"
version = "1.11.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
summary = "library with cross-python path, ini-parsing, io, code, log facilities"

[[package]]
name = "pympler"
version = "1.0.1"
requires_python = ">=3.6"
summary = "A development tool to measure, monitor and analyze the memory behavior of Python objects."

[[package]]
name = "pyparsing"
version = "3.0.8"
requires_python = ">=3.6.8"
summary = "pyparsing module - Classes and methods to define and execute parsing grammars"

[[package]]
name = "pytest"
version = "7.1.1"
requires_python = ">=3.7"
summary = "pytest: simple powerful testing with Python"
dependencies = [
    "atomicwrites>=1.0; sys_platform == \"win32\"",
    "attrs>=19.2.0",
    "colorama; sys_platform == \"win32\"",
    "iniconfig",
    "packaging",
    "pluggy<2.0,>=0.12",
    "py>=1.8.2",
    "tomli>=1.0.0",
]

[[package]]
name = "requests"
version = "2.27.1"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*, !=3.5.*"
summary = "Python HTTP for Humans."
dependencies = [
    "certifi>=2017.4.17",
    "charset-normalizer~=2.0.0; python_version >= \"3\"",
    "idna<4,>=2.5; python_version >= \"3\"",
    "urllib3<1.27,>=1.21.1",
]

[[package]]
name = "tomli"
version = "2.0.1"
requires_python = ">=3.7"
summary = "A lil' TOML parser"

[[package]]
name = "typing-extensions"
version = "4.2.0"
requires_python = ">=3.7"
summary = "Backported and Experimental Type Hints for Python 3.7+"

[[package]]
name = "urllib3"
version = "1.26.9"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*, <4"
summary = "HTTP library with thread-safe connection pooling, file post, and more."

